fromBase :: Int -> String -> Integer
fromBase base str =
    foldl' accum 0 digits
      where
        accum v c = v * base' + value c
        base'     = toInteger $ base
        value c   = toInteger $ digitToInt c
        digits    = filter isHexDigit str

enterString :: LexAction Token
enterString _ = do
