    setStr $ b <> (B.singleton . f . text $ m)
    nextToken

leaveString :: LexAction Token
leaveString _ = do
    b <- getStr
    setStr . B.fromString $ ""
    setStartCode 0
    return . LitStr . TL.unpack . B.toLazyText $ b

